const homeRouter = ()=> {

    const gettingdata = ()=>{
        return fetch("http://192.168.1.247:3001/api/user/home")
        .then((resp)=>{
            return resp.json()
        })
        .then(data=>{
            return data
        })
        .catch(err=>{
            console.log("1: ", err)
        })
    }

    return (
        <>
            <h1>this is the home page from home file</h1>
            {gettingdata()}
        </>
        );
}

export default homeRouter;
